A square and a regular heptagon  are coplanar and share a common side $\overline{AD}$, as shown. What is the degree measure of angle $BAC$?  Express your answer as a common fraction.

[asy]
for(int i=0; i <=7; ++i) {
draw(dir(360*i/7+90)--dir(360*(i+1)/7+90));
}
pair A = dir(360*3/7+90);
pair F = dir(360*4/7+90);
pair C = A+dir(90)*(F-A);
pair D = C+F-A;
pair B = dir(360*2/7+90);

draw(A--C--D--F);

label("$A$",A,S);
label("$B$",B,W);
label("$C$",C,SE);
label("$D$",F,S);

[/asy]

column7:
 Since angles of a regular heptagon are all congruent, each of these angles has a measure of $\dfrac{180(7-2)}{7} = \dfrac{900}{7}$ degrees.  Then \begin{align*}
\measuredangle CAB &= \dfrac{900}{7} \text{ degrees} \cdot \dfrac{1}{2} \text{ (since triangle } ABC \text{ is isosceles)} \\
& = \dfrac{450}{7} \text{ degrees}. \\
\end{align*}Note: The measure of a given central angle of a regular $n$-gon is $\dfrac{360}{n}$ degrees, so the measure of its inscribed angle is half this, or $\dfrac{180}{n}$ degrees.  In general, when a regular $n$-gon shares a vertex with a $k$-gon, where $k$ and $n$ are relatively prime, the angle between a side of each figure is then $\dfrac{2\pi}{nk}$ radians, or $\dfrac{360}{nk}$ degrees.  Angles $DAB and $CAD$ are inscribed angles of the heptagon, each intercepting $\dfrac{4}{7}$ of the circumference of the heptagon, so each has a degree measure of $\dfrac{\frac{4}{7} \cdot 360}{2} = \dfrac{2160}{14} = \dfrac{1080}{7}$. Angle $\angle BAC$ is the angle between the two inscribed angles by the arc, so $\angle BAC = \dfrac{1080}{7} - \dfrac{900}{7} = \dfrac{180}{7}$. This is $\dfrac{180}{7} \text{ degrees}$, which as a fraction of $360$ degrees is $\dfrac{\boxed{\dfrac{180}{7}}}{360} \cdot 360 = \boxed{\dfrac{180}{7}}$ degrees, or $\boxed{\dfrac{\frac{180}{7}}{360}} \cdot 360 = \boxed{\dfrac{180}{7}}$ degrees. The answer is \frac{\frac{180}{7}}{360}

