What is the degree measure of the smallest angle in triangle $PQS$? Please reason step by step, and put your final answer within \boxed{{}}. To find the smallest angle in triangle \(PQS\), we need to understand the geometric configuration of the circles and the triangle. Here's the step-by-step reasoning:

1. **Identify the centers and radii of the circles:**
   - Each circle has a radius of 1.
   - The centers of the circles are \(P\), \(Q\), \(R\), and \(S\).

2. **Determine the distances between the centers:**
   - Since the circles are tangent to each other, the distance between any two centers is the sum of their radii, which is \(1 + 1 = 2\).
   - Therefore, \(PQ = QR = RS = SP = 2\).

3. **Analyze the triangle \(PQS\):**
   - The triangle \(PQS\) has sides \(PQ = 2\), \(QS = 2\), and \(PS = 2\).
   - This means that triangle \(PQS\) is an equilateral triangle.

4. **Find the smallest angle in an equilateral triangle:**
   - In an equilateral triangle, all angles are equal.
   - The sum of the angles in any triangle is \(180^\circ\).
   - Therefore, each angle in an equilateral triangle is \(\frac{180^\circ}{3} = 60^\circ\).

Thus, the smallest angle in triangle \(PQS\) is \(\boxed{60}\).

