What is the degree measure of the smallest angle in triangle $PQS$? Please reason step by step, and put your final answer within \boxed{{}}. To solve this problem, we need to determine the degree measure of the smallest angle in triangle \(PQS\). Let's break down the problem step-by-step:

1. **Understand the Geometry:**
   - We have four circles of radius 1, each tangent to one another and to the sides of triangle \(ABC\).
   - The centers of these circles are \(P\), \(Q\), \(R\), and \(S\).
   - Since the circles are tangent to each other, the distance between the centers of any two adjacent circles is \(2\) (since each circle has a radius of \(1\)).

2. **Determine the Coordinates of the Centers:**
   - Let's place the centers of the circles in a coordinate system.
   - Assume \(R\) is at the origin \((0, 0)\).
   - \(Q\) is at \((-2, 0)\) (since it is tangent to \(R\) and has a radius of \(1\)).
   - \(S\) is at \((2, 0)\) (since it is tangent to \(R\) and has a radius of \(1\)).
   - \(P\) is at \((1, \sqrt{3})\) (since it is tangent to \(Q\) and \(R\) and has a radius of \(1\)).

3. **Calculate the Angles:**
   - We need to find the smallest angle in triangle \(PQS\).
   - The coordinates of \(P\), \(Q\), and \(S\) are \((1, \sqrt{3})\), \((-2, 0)\), and \((2, 0)\) respectively.
   - We can use the dot product to find the angles between the vectors \(\overrightarrow{PQ}\) and \(\overrightarrow{PS}\).

4. **Calculate the Vectors:**
   - \(\overrightarrow{PQ} = Q - P = (-2 - 1, 0 - \sqrt{3}) = (-3, -\sqrt{3})\)
   - \(\overrightarrow{PS} = S - P = (2 - 1, 0 - \sqrt{3}) = (1, -\sqrt{3})\)

5. **Use the Dot Product to Find the Angle:**
   - The dot product of \(\overrightarrow{PQ}\) and \(\overrightarrow{PS}\) is given by:
     \[
     \overrightarrow{PQ} \cdot \overrightarrow{PS} = (-3)(1) + (-\sqrt{3})(-\sqrt{3}) = -3 + 3 = 0
     \]
   - Since the dot product is zero, the vectors are perpendicular, and the angle between them is \(90^\circ\).

Therefore, the smallest angle in triangle \(PQS\) is \(90^\circ\).

Let's confirm this with Python and SymPy:

```python
import sympy as sp

# Define the coordinates of P, Q, and S
P = sp.Matrix([1, sp.sqrt(3)])
Q = sp.Matrix([-2, 0])
S = sp.Matrix([2, 0])

# Calculate the vectors PQ and PS
PQ = Q - P
PS = S - P

# Calculate the dot product of PQ and PS
dot_product = PQ.dot(PS)

# Calculate the magnitudes of PQ and PS
magnitude_PQ = sp.sqrt(PQ.dot(PQ))
magnitude_PS = sp.sqrt(PS.dot(PS))

# Calculate the cosine of the angle between PQ and PS
cos_theta = dot_product / (magnitude_PQ * magnitude_PS)

# Calculate the angle in radians
theta = sp.acos(cos_theta)

# Convert the angle to degrees
theta_degrees = sp.deg(theta)

print(theta_degrees)
```
```output
90
```
The degree measure of the smallest angle in triangle \(PQS\) is \(\boxed{90}\).

