Let's break down the problem step by step:

1. **Identify the relationship between the triangles:**
   Since \( \overline{AB} \parallel \overline{DE} \), triangles \( \triangle ABC \) and \( \triangle CDE \) are similar by the AA (Angle-Angle) similarity criterion. This means that the corresponding sides of these triangles are proportional.

2. **Determine the ratio of the sides:**
   Given \( BD = 4BC \), we can express the total length of \( BC \) as \( BC + BD = BC + 4BC = 5BC \). Therefore, the ratio of the corresponding sides of \( \triangle CDE \) to \( \triangle ABC \) is \( \frac{BC}{5BC} = \frac{1}{5} \).

3. **Calculate the ratio of the areas:**
   The ratio of the areas of two similar triangles is the square of the ratio of their corresponding sides. Thus, the ratio of the area of \( \triangle CDE \) to the area of \( \triangle ABC \) is \( \left(\frac{1}{5}\right)^2 = \frac{1}{25} \).

4. **Find the area of \( \triangle CDE \):**
   Since the area of \( \triangle ABC \) is 6 square centimeters, the area of \( \triangle CDE \) is \( 6 \times \frac{1}{25} = \frac{6}{25} \) square centimeters.

Therefore, the number of square centimeters in the area of \( \triangle CDE \) is \(\boxed{\frac{6}{25}}\).

