1. **Identify the coordinates of the points:**
   - Since \( CD = 3 \) and \( CD \) is horizontal, we can place point \( C \) at \( (0, 0) \) and point \( D \) at \( (3, 0) \).
   - Since \( BE = 5 \) and \( BE \) is horizontal, we can place point \( B \) at \( (0, 0) \) and point \( E \) at \( (5, 0) \).
   - Since \( CDEG \) is a square with side length 3, point \( G \) is at \( (3, 3) \) and point \( E \) is at \( (5, 3) \).

2. **Determine the coordinates of points \( F \) and \( H \):**
   - Point \( F \) is the intersection of the line through \( E \) parallel to \( AB \) and the line through \( A \) parallel to \( CD \). Since \( E \) is at \( (5, 3) \) and \( A \) is at \( (0, 0) \), the line through \( E \) parallel to \( AB \) is a vertical line at \( x = 5 \). The line through \( A \) parallel to \( CD \) is a horizontal line at \( y = 3 \). Therefore, point \( F \) is at \( (5, 3) \).
   - Point \( H \) is the intersection of the line through \( B \) parallel to \( CD \) and the line through \( E \) parallel to \( AB \). Since \( B \) is at \( (0, 0) \) and \( E \) is at \( (5, 0) \), the line through \( B \) parallel to \( CD \) is a horizontal line at \( y = 0 \). The line through \( E \) parallel to \( AB \) is a vertical line at \( x = 5 \). Therefore, point \( H \) is at \( (5, 0) \).

3. **Calculate the length \( BH \):**
   - The coordinates of \( B \) are \( (0, 0) \) and the coordinates of \( H \) are \( (5, 0) \). The distance \( BH \) is the horizontal distance between these two points, which is \( 5 - 0 = 5 \).

