[/asy] Please reason step by step, and put your final answer within \boxed{{}}. To find the area of a trapezoid, we can use the formula:

Area = (1/2) * (base1 + base2) * height

In this case, the bases are 5 cm and 9 cm, and the height is 3 cm. Plugging these values into the formula, we get:

Area = (1/2) * (5 + 9) * 3

Area = (1/2) * 14 * 3

Area = 7 * 3

Area = 21 square centimeters

So, the number of square centimeters in the area of this trapezoid is \boxed{21}.

